import React from 'react';
import './StatsSection.css';

const StatsSection: React.FC = () => {
  return (
    <section className="stats-section">
      <div className="container">
        <h2 className="stats-title">
          We <span className="highlight-golden">clarify</span> your brand messaging and help you <span className="highlight-golden">reach the right audience</span>
        </h2>
        <div className="stats-grid">
          <div className="stat-item">
            <div className="stat-number">$3m+</div>
            <div className="stat-label">Client revenue generated</div>
          </div>
          
          <div className="stat-item">
            <div className="stat-number">40+</div>
            <div className="stat-label">Projects completed</div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default StatsSection;
